import React from "react";

export default function Bodypart1() {
  return (
    <div className="body1">
      <h1 className="title-1">Generate Awesome Web Pages</h1>
      <p className="para2">
        The most important part of the Startup is the samples.The samples form a
        set of 25 usable pages you can use as is or you can add new blocks.
      </p>
      <button className="btn2">Learn More</button>
    </div>
  );
}
